                        theme="dark"  // alternative is light, which is white
                    />
                </div>
            </div> */}

            <div className={popupStyle}>
                <h3>Login successfully</h3>
                <p>Well-Come Aishwarya</p>
            </div>

        </div>
    )
}

export default LoginForm
